from typing import List


class Solution:
    def findMaxConsecutiveOnes(self, nums: List[int]) -> int:
        bigNum = 0
        num = 0
        for i in nums:
            if 1 == i:
                num += 1
            else:
                if bigNum < num:
                    bigNum = num
                num = 0
        if bigNum > num:
            return bigNum
        else:
            return num


